/*Table structure for table `sys_configinfo` */

DROP TABLE IF EXISTS `sys_configinfo`;

CREATE TABLE `sys_configinfo` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
